import React from "react";
import axios from 'axios';

import Card from './Card';

class ProblemList extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      questions: []
    }
  }

  componentDidMount() {
    axios.post('')
  }


}
export default ProblemList;
